tables.table_schema:
CREATE TABLE PlayerContracts (
    player_id UUID PRIMARY KEY,
    contract_value DECIMAL,
    signing_date DATE,
    expiration_date DATE
);

CREATE TABLE salaries (
  salary_id INT PRIMARY KEY,
  player_id INT,
  salary_amount INT,
  year INT
);

CREATE TABLE PlayerContracts (
    player_id INT PRIMARY KEY,
    team_id INT,
    contract_start_date DATE,
    contract_end_date DATE,
    salary DECIMAL
);

CREATE TABLE SalaryInformation (
    player_id INT PRIMARY KEY,
    salary DECIMAL,
    bonus DECIMAL,
    tax_withholding DECIMAL
);

CREATE TABLE TradeHistory (
    trade_id INT PRIMARY KEY,
    player_id INT,
    from_team_id INT,
    to_team_id INT,
    trade_date DATE
);

CREATE TABLE Teams (
    team_id INT PRIMARY KEY,
    team_name VARCHAR(50) UNIQUE
);

CREATE TABLE Teams (
  team_id INT PRIMARY KEY,
  team_name VARCHAR(50),
  city VARCHAR(50),
  state VARCHAR(50)
);

CREATE TABLE SalaryHistory (
  history_id INT PRIMARY KEY,
  player_id INT,
  salary DECIMAL(10, 2),
  effective_date DATE
);
